import React from 'react';
import {Link} from 'react-router-dom';

function Navbar() {
    const navbox = {
        backgroundColor: 'red',
        height: '60px'
    };
    const navbarstyle = {
        listStyleType: 'none',
        margin: '0',
        padding: '0'
    }
    return (
        <div style={navbox}>
            <ul style={navbarstyle}>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/tickets">Buy Tickets</Link>
                </li>
                <li>
                    <Link to="/rides">Rides</Link>
                </li>
                <li>
                    <Link to="/shops">Shops and Restaurants</Link>
                </li>
                <li>
                    <Link to="/events">Events</Link>
                </li>
                <li>
                    <Link to="/map">Map</Link>
                </li>
            </ul>
        </div>
    );
}

export default Navbar;
